<p>Currently, I have no problem getting connected and setting up my Schemas for NodeJS. I have a document within MongoDB that returns what my customers pay on fuel according to National Averages - our customers give us ranges for us to be able to find what specific dollar amount they are paying.</p>

<p>My MongoDB Document looks as the following :</p>

<pre><code>main_database
|- customerFSC (name of document)
|-- 
{
"_id":{"$oid":"5e5ecc04e8da861114079ab2"},
"custID":"01",
"custName":"Customer ABC",
"avgLow":["1.19","1.24","1.29","1.34","1.39","1.44","1.49","1.54","1.59","1.64","1.69","1.74","1.79","1.84","1.89","1.94","1.99"],
