I would not detail all the considerations, only mention that the query is being dynamically effected from parameters that the user enters and thus the query is not so naive:</p>

<pre><code>var anyMember = 'false';
db.PromotionLogRecord.aggregate({
    $match: {
        toSubscriberId: { 
            $cond: {
                if: {$expr:{$eq:[anyMember, 'true']}}, 
                then: ObjectId('000000000000000000000000'), 
                else: ObjectId('5cbc37583192ba000766a1e7')
            }}}},
 {$project:{'ID':'_id'}})
</code></pre>

<p>--> This query returns nothing, while this query returns results:</p>

