What is the best way to slowly (500/second) update many documents in a MongoDB database with a new field and value?<p>I have a MongoDB database that I want to update about 100,000 documents with a "score" for each on a daily basis. The challenge with the way I have implemented it is that it tries to update them really really fast (about 2,000 updates per second) and my MongoDB limits are set to only 500 updates per second (M5 tier) so MongoDB is sporadically throwing an error back to me (I confirmed with MongoDB support that this why I'm getting the error sometimes).</p>

<p>Is there a way to perhaps batch the updates or a better way to do what I'm doing?</p>

<p>Here's the code I am using. If I just turn it off when I get an error and start it back up it will eventually update all the documents, but that's an unsustainable solution:</p>

<pre><code>await client
  .db("test")
  .collection("collection_name")
  .find({ score: { $exists: false } })
  .forEach(async data =&gt; {
    await client
      .db("test")
      .collection("collection_name")
      .updateOne(
        { _id: data._id },
        {
          $set: {
            score: GetScore(data)
          }
        }
      );
  });
client.close();
</code></pre>

