<p>Is there a way to perhaps batch the updates or a better way to do what I'm doing?</p>

<p>Here's the code I am using. If I just turn it off when I get an error and start it back up it will eventually update all the documents, but that's an unsustainable solution:</p>

<pre><code>await client
  .db("test")
