client.close();
</code></pre>; Answer: ...what? Saying _preprocessor_ to describe the resolution of `structs` and `typedef`s is bad enough, but the rest of your writing is so confusing that I find it hard to get any message from it. One thing I can say, though, is that your idea that a non-`typedef`d `struct` cannot be forward-declared or used as an opaque (pointer) member is totally false. In your 1st example, `struct b` can trivially contain a `struct a *`, no `typedef` required. The assertions that `struct`s are merely dumb pieces of macro-expansion, and that `typedef`s give them revolutionary new powers, are painfully incorrect

