Dynamic from in $lookup<p>I am trying to see if i can change the <strong>from</strong> in the <strong>$lookup</strong> or rearrange my query to somehow retrieve from three potential collections. So far i have managed to set up the query like so:</p>

<pre><code>const search = db.collection("search");

search.aggregate([
  {
    '$match': {
      'id_int': 0
    }
  }, {
    '$project': {
      '_id': 0, 
      'collection': 1, 
      'id_int': 1
    }
  }, {
    '$lookup': {
      'from': 'arxiv', 
      'localField': 'id_int', 
      'foreignField': 'id_int', 
      'as': 'arxiv'
    }
  }
], function(err, cursor) ... )
</code></pre>

<p>The <strong>$match</strong> and then <strong>$project</strong> pipeline stages return a result with the following properties:</p>

<pre><code>collection:"arxiv"
